import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Following = () => {
    const [following, setFollowing] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:3001/currentUser/following', { withCredentials: true })
            .then(response => {
                setFollowing(response.data);
            })
            .catch(error => {
                console.error('Error fetching following users:', error);
            });
    }, []);

    return (
        <div>
            <h2>Following</h2>
            <ul>
                {following.map(follow => (
                    <li key={follow.followed._id}>{follow.followed.name}</li> // Assuming the followed user object has an _id and name
                ))}
            </ul>
        </div>
    );
};

export default Following;
